import React, {useEffect, useState} from 'react';
import AccountNavBar from "./accountNavBar";


const AccountList = () => {
    const [showData, setShowData] = useState<boolean>(false);
    const [showOrder, setShowOrder] = useState<boolean>(false);
    const [showHistoryOrder, setShowHistoryOrder] = useState<boolean>(false);

    useEffect(() => {
        if(showData){
            setShowOrder(false);
            setShowHistoryOrder(false);
        }
        if(showOrder){
            setShowOrder(false);
            setShowHistoryOrder(false);
        }
    }, [showData, showOrder, showHistoryOrder])
    return (
        <>
            <AccountNavBar
                showData={showData}
                showOrder={showOrder}
                showHistoryOrder={showHistoryOrder}
                setShowData={setShowData}
                setShowOrder={setShowOrder}
                setShowHistoryOrder={setShowHistoryOrder}
            />

        </>
    );
};

export default AccountList;
